  const [playlists, setPlaylists] = useState({ data: [] });

  useEffect(() => {
    get_playlists().then(data => setPlaylists(data)); 
  }, []);

  console.log('playlists: ', playlists.items);
  return (
    <div className="App">
     <h1>Playlists</h1>
